import React ,{ useState, useContext } from 'react';
import GridItem from "components/Grid/GridItem.js";
import GridContainer from "components/Grid/GridContainer.js";
import Table from "components/Table/Table.js";
import Card from "components/Card/Card.js";
import CardHeader from "components/Card/CardHeader.js";
import CardBody from "components/Card/CardBody.js";
import { makeStyles } from "@material-ui/core/styles";
import Button from '@material-ui/core/Button'
import {Link} from 'react-router-dom'
import { EmployeeDataContext } from 'views/Employee/Add'
const styles = {
    cardCategoryWhite: {
      "&,& a,& a:hover,& a:focus": {
        color: "rgba(255,255,255,.62)",
        margin: "0",
        fontSize: "14px",
        marginTop: "0",
        marginBottom: "0"
      },
      "& a,& a:hover,& a:focus": {
        color: "#FFFFFF"
      }
    },
    cardTitleWhite: {
      color: "#FFFFFF",
      marginTop: "0px",
      minHeight: "auto",
      fontWeight: "300",
      fontFamily: "'Roboto', 'Helvetica', 'Arial', sans-serif",
      marginBottom: "3px",
      textDecoration: "none",
      "& small": {
        color: "#777",
        fontSize: "65%",
        fontWeight: "400",
        lineHeight: "1"
      }
    },
    // button:{
    //     flexDirection: 'row', 
    //     justifyContent: 'flex-end',
    //     alignSelf: 'flex-end',
    //     alignItems: 'flex-end'
    // }
  };

  const useStyles = makeStyles(styles);

function Employee(props) {
  // const [employeeData]=useContext(EmployeeDataContext)
  const classes = useStyles();
  const data=props.data;
  // console.log("hii",employeeData)
    return (
        <div>
            <GridContainer>
      <GridItem xs={12} sm={12} md={9}>
        <Card>
          <CardHeader  color="primary">
            <h4 className={classes.cardTitleWhite}>
              Employee
            </h4>
            <p className={classes.cardCategoryWhite} style={{display:' inline'}}>
              Here is the list of employee
            </p>
            <Button variant="contained" style={{float:'right'}} color="primary"  component={Link} to="/admin/addEmployee">
                Add Employee
            </Button>

          </CardHeader>
          <CardBody>
            <Table
              tableHeaderColor="primary"
              tableHead={["Name", "State","Country", "City", "Salary"]}
              tableData={[
                // data
                ["1", "Dakota Rice", "$36,738", "Niger", "Oud-Turnhout"],
                ["2", "Minerva Hooper", "$23,789", "Curaçao", "Sinaai-Waas"],
                ["3", "Sage Rodriguez", "$56,142", "Netherlands", "Baileux"],
                [
                  "4",
                  "Philip Chaney",
                  "$38,735",
                  "Korea, South",
                  "Overland Park"
                ],
                [
                  "5",
                  "Doris Greene",
                  "$63,542",
                  "Malawi",
                  "Feldkirchen in Kärnten"
                ],
                ["6", "Mason Porter", "$78,615", "Chile", "Gloucester"]
              ]}
            />
          </CardBody>
        </Card>
      </GridItem>
    </GridContainer>
        </div>
    );
}

export default Employee;
